import React, { Component } from "react";
import PropTypes from "prop-types";




class Form1 extends Component {




    setGender(event) {
        console.log(event.target.value);
    }

  render() {
    return (
      <div>
        <h1>Aplicant information </h1>
        <div className="field">
          <label> Name </label>
          <input class="input" type="text" placeholder="Enter name" />
        </div>
        <div className="field">
          <label> Surname </label>
          <input class="input" type="text" placeholder="Enter Surname" />
        </div>
        <div className="field">
          <label> Email </label>
          <input class="input" type="text" placeholder="Enter Email" />
        </div>
        <div className="field">
          <label> contact </label>
          <input class="input" type="text" placeholder="Enter Contacts" />
        </div>
        <div className="field">
          <label> date of birth </label>
          <input type="text" class="input" placeholder="date of birth" />
        </div>
        <div onChange={this.setGender.bind(this)}>
          <label style={{ display: "block", margin: "1rem" }}> Gender </label>
          <input type="radio" value="MALE" name="gender" /> Male
          <input type="radio" value="FEMALE" name="gender" /> Female
        </div>
      </div>
    );
  }
}

Form1.propTypes = {};

export default Form1;
